Dragon separation confirmed! The spacecraft will now execute four departure burns to move away from the 
@space_station
. Dragon will reenter the Earth's atmosphere and splashdown in ~23.5 hours

More photos from last night's Falcon 9 launch of 
@NASA
's double asteroid redirection test → http://flickr.com/spacex/

Watch Dragon depart the 
@space_station
 and return to Earth with Crew-2 astronauts → http://spacex.com/launches

Following Crew-2’s return to Earth, Falcon 9 will launch Dragon’s third long-duration crew mission to the 
@Space_Station
 as soon as Wednesday, November 10; weather forecast is 80% favorable for liftoff

After a six-month stay, Dragon and the Crew-2 astronauts are set to depart the 
@space_station
 today at ~2:00 p.m. ET → http://spacex.com/launches

Crew-3 astronauts, SpaceX, and 
@NASA
 completed a full rehearsal of launch day activities

The 
@inspiration4x
 crew is set to return to Earth on Saturday, September 18 with a targeted splashdown at 7:06 p.m. EDT in the Atlantic Ocean off the coast of Florida

The 
@Inspiration4x
 crew will share a live on-orbit update about their multi-day journey aboard the Dragon spacecraft at ~5:00 p.m. ET today → http://youtu.be/E71ffwc13y4

Just spoke with 
@inspiration4x
 crew. All is well.

@Space_Station
, your package is ready for delivery.

Tomorrow, Aug. 28, a 
@SpaceX
 Dragon spacecraft launches to the orbiting lab with tons of cargo, including assortments of cheese, ice cream, & veggies for the crew!

Watch LIVE at 3:15am ET (07:15 UT): http://nasa.gov/live

Static fire test complete – targeting Saturday, August 28 at 3:37 a.m. EDT for Falcon 9 launch of Dragon’s 23rd cargo resupply mission to the 
@space_station
 → http://spacex.com/launches

Crew-3 astronauts visited 
@NASAKennedy
 this week for emergency preparedness training
